// import "./coursecard.css"

function CourseCard({ course }) {
    return (
        <div className="card">
            <div className="card-header container-fluid">
                <h3>{course.courseName}</h3>
                <div className="row d-contents">

                </div>
            </div>
        </div>
    )
}

export default CourseCard
